import React from 'react';
import { DataGrid } from '@material-ui/data-grid';


const CompGetDaily = () => {

    const URI = "http://localhost:8081/comidas/"

    /*const columns = [
        { field: 'id', headerName: 'ID', width: 90 },
        {
          field: 'firstName',
          headerName: 'First name',
          width: 150,
          editable: true,
        },
        {
          field: 'lastName',
          headerName: 'Last name',
          width: 150,
          editable: true,
        },
        {
          field: 'age',
          headerName: 'Age',
          type: 'number',
          width: 110,
          editable: true,
        }
      ];
      
      const rows = [
        { id: 1, lastName: 'Snow', firstName: 'Jon', age: 35 }
      ];

    return (
        <div style={{ height: 400, width: '100%' }}>
            <DataGrid
                rows={rows}
                columns={columns}
                pageSize={5}
                checkboxSelection
                disableSelectionOnClick
            />
        </div>
    )*/

    return (
      <table class="table">
        <thead>
          <tr>Día</tr>
          <tr>
            <th>Nombre y Apellidos</th>
            <th></th>
            <th>Día</th>
          </tr>
        </thead>
        <tbody>
          <tr>
            <td scope="row"></td>
            <td>Jorge Cuad</td>
            <td>20/05</td>
          </tr>
          <tr>
            <td scope="row"></td>
            <td>Felipe Pamies</td>
            <td>11/05</td>
          </tr>
        </tbody>
      </table>
    )
}

export default CompGetDaily;
